import React, { Component } from "react";

import UserService from "../services/user.service";
import EventBus from "../common/EventBus";
import Addcomponent from "./Addcomponent";
import authService from "../services/auth.service";
import AppModal from "./AppModal";
export default class BoardUser extends Component {

   selectitem(getitems){
    console.log(getitems);
  };
  constructor(props) {
    super(props);
    this.state = {
      content: "",
      currentTutorial: [],
    };
  }

  componentDidMount() {
    const currentUser = authService.getCurrentUser();
    UserService.getUserBoard(currentUser.username).then(
      (response) => {
        this.setState({
          currentTutorial: response.data,
        });
        console.log(response);
      },
      (error) => {
        this.setState({
          content:
            (error.response &&
              error.response.data &&
              error.response.data.message) ||
            error.message ||
            error.toString(),
        });

        if (error.response && error.response.status === 401) {
          EventBus.dispatch("logout");
        }
      }
    );
  }



  render() {
    const { currentTutorial } = this.state;
    return (
      <div className="container">
        <header className="jumbotron pt-4">
          <div className="row">
            <div className="col-sm-6 ">
              <div className="card mt-0">
                  <Addcomponent />
              </div>
            </div>
            <div className="col-sm-6">
              <div className="card mt-0">
                  <AppModal />
              </div>
            </div>
          </div>

          <div className="container ">
            <div className="crud shadow-lg p-5 mb-3 mt-3 bg-body rounded">
              <div className="row ">
                <div className="col-sm-3 mt-5 mb-4 text-gred"></div>
                <div
                  className="col-sm-3 offset-sm-2 mt-3 mb-3 text-gred"
                  style={{ color: "#198754" }}
                >
                  <h2>
                    <b>Ewaste Details</b>
                  </h2>
                </div>
              </div>
              <div className="row">
                <div className="table-responsive ">
                  <table className="table table-striped table-hover table-bordered">
                    <thead>
                      <tr>
                        <th>Id</th>
                        <th>E-Name</th>
                        <th>E-Description</th>
                        <th>Quantity</th>
                        <th>Weight</th>
                        <th>Actions</th>
                      </tr>
                    </thead>
                    <tbody>
                      {currentTutorial.map((getitems) => (
                        <tr key={getitems.id}>
                          <td>{getitems.id}</td>
                          <td>{getitems.title}</td>
                          <td>{getitems.description}</td>
                          <td>{getitems.quantity}</td>
                          <td>{getitems.weight}</td>
                          <td>
                            {/*<i style={{ color: "#10ab80" }} className="material-icons">&#xE417;</i>*/}
                            <button className="btn btn-light">
                              <i
                                style={{ color: "#198754" }}
                                className="material-icons"
                                onClick={() => {
                                  this.selectitem(getitems);
                                 }}
                              >
                                &#xE254;
                              </i>
                            </button>

                            <button className="btn btn-light">
                              <i
                                style={{ color: "red" }}
                                onClick={() => {
                                  UserService.delete(getitems.id);
                                  this.componentDidMount();
                                }}
                                className="material-icons"
                              >
                                &#xE872;
                              </i>
                            </button>
                          </td>
                        </tr>
                      ))}
                    </tbody>
                  </table>
                </div>
              </div>
            </div>
          </div>
        </header>
      </div>
    );
  }
}
